      email: "ram999jayaram@gmail.com",
      status: false,
    },

    {
      id: 20,
      user_id: 3,
      survey_date: "26/04/2023",
      email: "ram999jayaram@gmail.com",
      status: false,
    },
  ]);
  const [addUserOpen, setAddUserOpen] = React.useState(false);
  const [email, setEmail] = React.useState("");
  const [emailError, setEmailError] = React.useState("");
  const [searchValue, setSearchValue] = React.useState("");
  const [sortOrder, setSortOrder] = React.useState("");
  const [sortColumn, setSortColumn] = React.useState("");
  console.log(rowValues.length);
  // Avoid a layout jump when reaching the last page with empty rows.
  const handleSortClick = (column) => {
    if (sortColumn === column) {
      setSortOrder(sortOrder === "asc" ? "desc" : "asc");
    } else {
      setSortOrder("desc");
      setSortColumn(column);
    }
  };

  const rowValuesSorted = rowValues.sort((a, b) => {
    const sortOrderVal = sortOrder === "asc" ? 1 : -1;
    console.log(sortColumn, "sortColumn");
    switch (sortColumn) {
      case "id":
        return (a.id - b.id) * sortOrderVal;
      case "email":
        return a.email.localeCompare(b.email) * sortOrderVal;
      case "date":
        return new Date(a.survey_date) - new Date(b.survey_date) * sortOrderVal;
      case "status":
        return (a.status - b.status) * sortOrderVal;
      default:
        return 0;
    }
  });

  const emptyRows =
    page > 0 ? Math.max(0, (1 + page) * rowsPerPage - rowValues.length) : 0;

  const handleChangePage = (event, newPage) => {
    setPage(newPage);
  };

  const handleChangeRowsPerPage = (event) => {
    setRowsPerPage(parseInt(event.target.value, 10));
    setPage(0);
  };
  const handleAddUserOpen = (e) => {
    e.preventDefault();
    setAddUserOpen(true);
  };
  const handleAddUserClose = () => {
    setAddUserOpen(false);
    setEmail("");
    setEmailError("");
  };

  const storeEmail = (event) => {
    setEmail(event.target.value);
    const emailRegex = /\S+@\S+\.\S+/;
    if (event.target.value == "") {
      setEmailError("Enter Email");
    } else if (!emailRegex.test(event.target.value)) {
      setEmailError("Invalid Email");
    } else {
      setEmailError("");
    }
  };

  const sendMailData = () => {
    const userId = Cookies.get("id");
    if (email == "") {
      setEmailError("Enter Email");
    } else if (emailError === "") {
      //  logic here
      axios
        .post(url.API + "survey", { email, user_id: userId })
        .then((response) => {
          setEmail("");
          // toast sucesss
          toast.success(" Mail sent", {
            position: "top-right",
            autoClose: 5000,
            hideProgressBar: false,
            closeOnClick: true,
            pauseOnHover: true,
            draggable: true,
            progress: undefined,
            theme: "light",
          });
          setTimeout(() => {
            setAddUserOpen(false);
          }, 2000);
          console.log(response);
        })
        .catch((error) => {
          setEmail("");
          toast.error(" Mail  not sent", {
            position: "top-right",
            autoClose: 5000,
            hideProgressBar: false,
            closeOnClick: true,
            pauseOnHover: true,
            draggable: true,
            progress: undefined,
            theme: "light",
          });
          console.log(error.data);
        });
      handleAddUserClose();
    }
  };
  const storingSearchValue = (event) => {
    setSearchValue(event.target.value);
  };
  //geting userdata
  const getSurveyData = () => {
    axios
      // add id here
      .get(url.API + `userSurveys/${3}?search_result=` + searchValue)
      .then((response) => {
        if (response.statusText === "OK") {
          console.log(response);
          setRowValues(response.data);
        }
      })
      .catch((error) => {
        console.log(error);
      });
  };
  React.useEffect(() => {
    getSurveyData();
  }, [searchValue, sortOrder]);
  // React.useEffect(() =>{

  // },[sortOrder]);
  console.log(sortOrder, "order");
  console.log(rowValuesSorted);
  return (
    <div className="table-testing-container">
      <div className="search-invite-container">
        <Box
          sx={{
            display: "flex",
            flexDirection: "row",
            alignItems: "flex-end",
            justifyContent: "space-between",
          }}
        >
          <Box
            sx={{
              borderWidth: "2px",
              borderColor: "E0E0E0",
              borderStyle: "solid",
              borderRadius: "8px",
            }}
          >
            <div className="search-container-div">
              <SearchIcon />
              <input
                className="input-search-table"
                type="text"
                placeholder="search email"
                value={searchValue}
                onChange={storingSearchValue}
              />
            </div>
          </Box>

          <button className="table-search-button" onClick={handleAddUserOpen}>
            Invite
          </button>
          <Dialog open={addUserOpen} onClose={handleAddUserClose}>
            <DialogTitle>Invite</DialogTitle>
            <DialogContent>
              <DialogContentText>
                please enter email address here.
              </DialogContentText>

              <TextField
                autoFocus
                margin="dense"
                id="name"
                label="Email Address"
                type="email"
                fullWidth
                variant="standard"
                value={email}
                onChange={(e) => storeEmail(e)}
                error={emailError}
                helperText={emailError}
              />
            </DialogContent>
            <DialogActions>
              <Button onClick={handleAddUserClose}>Cancel</Button>
              <Button onClick={sendMailData} type="button">
                Send
              </Button>
            </DialogActions>
          </Dialog>
        </Box>
      </div>
      <Paper sx={{ maxWidth: "1200px" }}>
        <TableContainer>
          <Table sx={{ minWidth: 500 }} aria-label="custom pagination table">
            <TableHead>
              <TableRow>
                <StyledTableCell>
                  <ArrowUpwardIcon
                    onClick={(id) => {

                      handleSortClick(id);
                      setSortOrder("desc");
                    }}
                  />
                  Id
                  <ArrowDownwardIcon
                    onClick={(id) => {

                      handleSortClick(id);
                      setSortOrder("asc");
                    }}
                  />
                </StyledTableCell>

                <StyledTableCell>Email</StyledTableCell>
                <StyledTableCell>Date</StyledTableCell>
                <StyledTableCell>Status</StyledTableCell>
              </TableRow>
            </TableHead>
            <TableBody>
              {rowValuesSorted

                .slice(page * rowsPerPage, page * rowsPerPage + rowsPerPage)
                .map((row) => (
                  <StyledTableRow key={row.id}>
                    <StyledTableCell style={{ width: 100 }}>
                      {row.id}
                    </StyledTableCell>
                    <StyledTableCell
                      // 嚙廣endMail
                      // 嚙廣ebleCell
                      style={{ width: 100 }}
                      component="th"
                      scope="row"
                    >
                      {row.email}
                    </StyledTableCell>

                    <StyledTableCell style={{ width: 100 }}>
                      {row.survey_date}
                    </StyledTableCell>

                    <StyledTableCell style={{ width: 100 }}>
                      {row.status ? "Completed" : "Incompleted"}
                    </StyledTableCell>
                  </StyledTableRow>
                ))}

              {emptyRows > 0 && (
                <TableRow style={{ height: 53 * emptyRows }}>
                  <TableCell colSpan={6} />
                </TableRow>
              )}
            </TableBody>
            <TableFooter>
              <TableRow>
                <TablePagination
                  rowsPerPageOptions={[5, 10, 25, { label: "All", value: -1 }]}
                  colSpan={3}
                  count={rowValues.length}
                  rowsPerPage={rowsPerPage}
                  page={page}
                  SelectProps={{
                    inputProps: {
                      "aria-label": "rows per page",
                    },
                    native: true,
                  }}
                  onPageChange={handleChangePage}
                  onRowsPerPageChange={handleChangeRowsPerPage}
                  ActionsComponent={TablePaginationActions}
                />
              </TableRow>
            </TableFooter>
          </Table>
        </TableContainer>
      </Paper>
      <ToastContainer
        position="top-right"
        autoClose={5000}
        hideProgressBar={false}
        newestOnTop={false}
        closeOnClick
        rtl={false}
